"    window.addEventListener('message', (event) => {
        const {type, value} = event.data;
        if (type === '__TRINITY_TTS__' && value.action === 'resize') {
            const height = value.message.height.int;
            window.webkit.messageHandlers.trinityResizeListener.postMessage(height);
        } else if (type === 'TRINITY_TTS') {
            const payload = {
                origin: event.origin,
                data: event.data
            };

            window.webkit.messageHandlers.trinityPostMessageListener.postMessage(payload);
        }
    })"
